import React from 'react';

function MainContent() {
    return (
        <div className="mainContent">
            var elem = document.createElement ("img");
            elem.setAtribute("src", "https://www.freepik.com/premium-vector/colorful-birds-beautiful-trees_3364917.htm");
            <h2>Hi my name is Vivien and this is what I'm about</h2>
            <p>This is some interesting stuff right here!</p>
            <p>This is another interesting point!</p>
        </div>
        
    );
}

export default MainContent;
